#evaluate an ARIMA model using a walk-forward validation
from pandas import read_csv
from pandas import datetime
from statsmodels.tsa.arima_model import ARIMA
from sklearn.metrics import mean_squared_error
from math import sqrt
# split into train and test sets
X = data.values
size = int(len(X) * 0.66)
train, test = X[0:size], X[size:len(X)]
history = [x for x in train]
predictions = list()
# walk-forward validation
for t in range(len(test)):
	model = ARIMA(history, order=(2, 1, 2))
	model_fit = model.fit(disp=-1)
	output = model_fit.forecast()
	yhat = output[0]
	predictions.append(yhat)
	obs = test[t]
	history.append(obs)
	print('predicted=%f, expected=%f' % (yhat, obs))
plt.figure(figsize=(10,5))
# evaluate forecasts
rmse = sqrt(mean_squared_error(test,predictions))
print('RMSE: %.4f'% np.sqrt(sum((predictions -test)**2)/len(ts)))

# plot forecasts against actual outcomes

plt.plot(predictions)
plt.plot(test)
plt.show()

"""#**5.7) MODEL ANALYSIS**"""

import sklearn.metrics as sm
from sklearn import metrics
print("Mean absolute error =", round(sm.mean_absolute_error(test, predictions), 2)) 
print("Mean squared error =", round(sm.mean_squared_error(test, predictions), 2)) 
print("Median absolute error =", round(sm.median_absolute_error(test, predictions), 2)) 
print("Explain variance score =", round(sm.explained_variance_score(test, predictions), 2)) 
print("R2 score =", round(sm.r2_score(test, predictions), 2))
print(np.sqrt(metrics.mean_squared_error(test, predictions)))

rmspe = (np.sqrt(np.mean(np.square((test - predictions) / test)))) * 100
rmspe

def compute_accuracy(test, predictions_ARIMA):
    correct_predictions = 0
    # iterate over each label and check
    for true, predicted in zip(test, predictions_ARIMA):
        if true == predicted:
            correct_predictions += 1
    # compute the accuracy
    accuracy = correct_predictions/len(test)
    return accuracy
# get the accuracy
compute_accuracy(test, predictions_ARIMA)

